import React from 'react';
import {BrowserRouter,Route} from 'react-router-dom';


const PageOne = () => {
    return <div>PAGE 1</div>
}

const PageTwo = () => {
    return <div>PAGE 2</div>
}



const App = () => {
    return(
        <BrowserRouter>
        <div>
        <Route path="/" exact component={PageOne} />
        <Route path="/pagetwo" component = {PageTwo}/>
        </div>
        </BrowserRouter>
    )
}

export default App;
